import React, { Component } from 'react';
import './App.js'
import Tab from './Components/TabList'
import Body from './Components/Body'

export class App extends Component {
  constructor(){
    super();
    this.state = {
      activeTab:1
    }
    this.changeTab = (id) => {
      this.setState({
        activeTab: id
      })
    }
  }
  render(){
    const tabs = [
      {
        id:1,
        title:'Home'
      },
      {
        id: 2,
        title:'Images'
      },
      {
        id:3,
        title:'Videos'
      }
    ]
    return(
      <div className="body">
        <div className="nav-bar">
        <Tablist tabs={tabs}/>
        </div>
        <div className="main-body">
        <Body/>
        </div>
      </div>
    );
  }
}

export default App;
